@SorareLegion Mouai ca couterait trop cher à sorare. 
Je préfère qu'ils rémunèrent mieux les bonnes perf et les gens qui sont bons.
Je suis rentré dans le jeu en janvier, mais ca ne me dérange pas si on ne retrouve pas les prix dingues de février mars. Les limited doivent rester abordables.
